import Link from 'next/link';

const NavBars = () => (

    <div className="navigateBar">

    <div>
      <Link href="/Work">WORK</Link>
      </div>

       <div>
       <Link href="/About">ABOUT</Link>
       </div>

     <div>
     <Link href="/contact">CONTACT</Link> 
     </div>

     </div>
);

export default NavBars;
